DELIMITER //
CREATE PROCEDURE `sp_guardar_evento`(
	IN `NombreEve` VARCHAR(60),
	IN `FechaEve` DATE,
	IN `EstadoEve` INT,
	IN `NombreOrg` VARCHAR(50),
	IN `InstipPro` VARCHAR(70),
	IN `TipoParti` VARCHAR(50),
	IN `TipoEve` VARCHAR(50),
	IN `Objetivo` VARCHAR(100),
	IN `EFES` INT,
	IN `DescriEve` VARCHAR(200)
)
BEGIN
	
	INSERT INTO evento (Nom_evento,Fch_evento,Sts_evento) VALUES (NombreEve, FechaEve, EstadoEve);
	SET @id_insercion = 0 ;
	SELECT MAX(ID_evento) INTO @id_insercion FROM evento;
	INSERT INTO informacion_evento (ID_evento,Tip_infoento,Obj_infoento,Efe_infoento,Dsc_infoento) VALUES (@id_insercion, TipoEve, Objetivo,EFES, DescriEve);
	INSERT INTO organizador_evento (ID_evento, Nom_Organi, InP_Organi, Tip_Part)VALUES (@id_insercion, NombreOrg, InstipPro, TipoParti); 
 	
END//
DELIMITER ;

-- Volcando estructura para procedimiento ciecas.sp_guardar_imagen
DELIMITER //
CREATE PROCEDURE `sp_guardar_imagen`(
	IN `ruta` LONGBLOB
)
BEGIN
	SET @id_insercion = 0 ;
	SELECT MAX(ID_evento) INTO @id_insercion FROM evento;
	INSERT INTO imagenes_eventos (ID_evento, imagen) VALUES (@id_insercion, ruta);
END//
DELIMITER ;

